import React from 'react'
import Card from "react-bootstrap/Card";
import styler from './styler.css'

function IntroCard() {
    return (
        <div class="Container">
            <Card className="intro-card">
                <Card.Body className="intro-card-text">Welcome, XYZ.</Card.Body>
                <Card.Body className="intro-card-subtext">xyz@gmail.com</Card.Body>
            </Card>
        </div>
    )
}

export default IntroCard
